subFields.atClick:
let cfSelected;
let enteSelected;
try{
cfSelected = utils.getValues('codice_fiscale_beneficiario');	
enteSelected ='C_DEMO';  /*utils.getValues('frm_ipa');*/
}catch(e){enteSelected='C_DEMO'; console.log("IPA: "+ enteSelected+" CF:"+cfSelected);}

var qs;
qs = { codiceFiscale: cfSelected, ente:enteSelected};
var url = 'http://mypa.local:9081/regfragilita/api/consultazione/anagraficaCittadinoByCFEnte';
console.log("enteSelected: "+enteSelected); 
try {

	if (qs) 
	return utils.fetchExternalData(url, 'GET', qs).then(value => {

        if (value!==null && typeof value!=="undefined" && value.entity) {

		   popolaCampi(value);

         } else {

		 return propClear();

        }


	return utils.fetchExternalData(url, 'GET', qs).then(value => {

        if (value!==null && typeof value!=="undefined" && value.entity) {

		  return popolaCampi(value);

         } else {

		 return propClear();

        }

    });

	});
} catch (e) {
    console.log('errore');
    return Promise.resolve(null);

};

function popolaCampi(value){

	if (value!==null && typeof value!=="undefined" && value.entity) {
            var cittadino = value.entity;	

		for(let i=1;i<16;i++){
		utils.setValues('cf_fam_'+i, "");
		utils.setValues('cognome_fam_'+i, "");
		utils.setValues('nome_fam_'+i,  "");
		utils.setValues('tpr_fam_'+i,  "");
		utils.setValues('sesso_fam_'+i,  "");
	    }

	utils.setValues('numero_di_telefono_beneficiario', cittadino.telefono +' - '+ cittadino.cellulare);
	utils.setValues('indirizzo_posta_elettronica_beneficiario', cittadino.email);
	utils.setValues('nome_beneficiario', cittadino.nome);
	utils.setValues('cognome_beneficiario', cittadino.cognome);
	utils.setValues('comune_residenza_beneficiario', cittadino.descrizioneComuneResidenza);
	utils.setValues('cap_residenza_beneficiario', cittadino.capResidenza);
	utils.setValues('indirizzo_residenza_beneficiario', cittadino.indirizzoResidenza);
	utils.setValues('cittadinanza_beneficiario', cittadino.cittadinanza);

		let familiari=[];	
		if(typeof cittadino.anagraficaNucleoFamiliare !=="undefined" && cittadino.anagraficaNucleoFamiliare.length>0){

		utils.setValues('num_componenti_nucleo',cittadino.anagraficaNucleoFamiliare.length);	

		let count=1;
		cittadino.anagraficaNucleoFamiliare.forEach(entity => {
		if(count<16){
		(function(count,entity){
		utils.setValues('cf_fam_'+count, entity.codiceFiscale);
		utils.setValues('cognome_fam_'+count, entity.cognome);
		utils.setValues('nome_fam_'+count, entity.nome);
		utils.setValues('tpr_fam_'+count, entity.rapportoParentela);
		utils.setValues('sesso_fam_'+count, entity.sesso);
		})(count,entity);

		}
		count++;
		});

		}else{ utils.setValues('num_componenti_nucleo',cittadino.numeroComponentiNucleoFamiliare);	}

		if(cittadino.datiEconomici){
			utils.setValues('informazioni_sulla_condizione_economica_reddito', cittadino.datiEconomici.valoreIsee);
                 utils.setValues('informazioni_patrimoniale_mobiliare', cittadino.datiEconomici.valorePatrimonioMobiliare);
		utils.setValues('informazioni_patrimoniale_immobiliare', cittadino.datiEconomici.valorePatrimonioImmobiliare);
			utils.setValues('prestazioni_sociali_erogate_ai_componenti_del_nucleo_familiare', '');
		}

		return value;

         } else {

		 return propClear();

        }	


};

function propClear(){

		utils.setValues('numero_di_telefono_beneficiario', '');
		utils.setValues('indirizzo_posta_elettronica_beneficiario', '');
		utils.setValues('nome_beneficiario', '');
		utils.setValues('cognome_beneficiario', '');
		utils.setValues('comune_residenza_beneficiario', '');
		utils.setValues('cap_residenza_beneficiario', '');
		utils.setValues('indirizzo_residenza_beneficiario', '');
		utils.setValues('cittadinanza_beneficiario', '');
		utils.setValues('num_componenti_nucleo','0');	

		for(let i=1;i<16;i++){
		utils.setValues('cf_fam_'+i, "");
		utils.setValues('cognome_fam_'+i, "");
		utils.setValues('nome_fam_'+i,  "");
		utils.setValues('tpr_fam_'+i,  "");
		utils.setValues('sesso_fam_'+i,  "");
		}	

		utils.setValues('informazioni_sulla_condizione_economica_reddito', '');
		utils.setValues('informazioni_patrimoniale_mobiliare', '');
		utils.setValues('informazioni_patrimoniale_immobiliare', '');
		utils.setValues('prestazioni_sociali_erogate_ai_componenti_del_nucleo_familiare', '');	 
		utils.setValues('list_array_nucleo_familiare','');	

		return null;

};

